sources.styles/utils/header.scss:
.header {
  padding: 20px 20px 0;

  @include onDesctop {
    padding: 32px 32px 0;
  }

  &__logo {
    height: 24px;
  }

  &__open-aside {
    background: no-repeat url(/images/icon/icon-aside.png);
    width: 20px;
    @include onDesctop {
      display: none;
    }
  }

  &__top {
    margin-bottom: 32px;
    display: flex;
    justify-content: space-between;
    @include onTablet {
      margin-bottom: 80px;
    }
    @include onDesctop {
      margin-bottom: 135px;
    }
  }

  &__content {
    display: flex;
    flex-direction: column;
    align-content: center;
    position: relative;
    margin-bottom: 100px;
    @include onTablet {
      margin-bottom: 225px;
    }
    @include onDesctop {
      margin-bottom: 290px;
    }
  }

  &__content-paragraf {
    margin-bottom: 32px;
    text-align: center;
    @include onTablet {
      text-align: start;
      align-self: start;
      margin-bottom: 146px;
    }
    @include onDesctop {
      text-align: start;
      align-self: start;
      margin-bottom: 40px;
    }
  }

  &__bakery-images {
    z-index: -1;
    left: 35%;

    @include onTablet {
      top: 25%;
      max-height: 328px;
      position: absolute;
    }
    @include onDesctop {
      min-height: 546px;
      position: absolute;
    }
  }

  &__content-title {
    text-transform: uppercase;
    font-weight: 400;
    font-size: 64px;
    line-height: 85%;
    text-align: center;
    color: $color-text;
    letter-spacing: -0.05em;
    @include onTablet {
      font-size: 80px;
      margin-bottom: 210px;
    }
    @include onDesctop {
      font-size: 136px;
    }
    @include onDesctop {
      margin-bottom: 64px;
    }
  }
}

sources.styles/utils/mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onTablet {
  @media (min-width: 640px) and (max-width: 1023px) {
    @content;
  }
}

@mixin onDesctop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin pageGrid {
  --column: 2;
  display: grid;
  column-gap: 16px;
  grid-template-columns: repeat(var(--column), 1fr);

  @include onTablet {
    --column: 8;
    column-gap: 24px;
  }

  @include onDesctop {
    --column: 8;
    column-gap: 24px;
  }
}

sources.styles/utils/aside.scss:
.menu__aside {
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  height: 100vh;
  pointer-events: none;
  transition: all 0.5s;
  transform: translateX(-100%);
  background: #eef7ff;
  z-index: 1;

  &--logo {
    height: 24px;
  }

  &:target {
    pointer-events: all;
    transform: translateX(0);
  }

  &-top {
    padding: 20px 20px 0;
    display: flex;
    justify-content: space-between;
    margin-bottom: 132px;
  }
}

.nav__list--position {
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 24px;
}

